import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";
function Expenses(props) {
  return (
    <ExpenseItem
      date={props.date}
      amount={props.amount}
      title={props.amount}
    ></ExpenseItem>
  );
}

export default Expenses;
